import React from "react";
import "./textArea.css";

function InputField(props) {
  return (
    <div
      className="ui segment"
      style={{
        marginLeft: "5%",
        marginRight: "5%",
        marginBottom: "5%",
        marginTop: "2%",
        width: "2vw",
      }}
    >
      <h3>Enter the Input</h3>
      <input
        type="text"
        // rows="7"
        placeholder={props.val}
        onChange={(e) => props.dispatch(e.target.value)}
      ></input>
    </div>
  );
}

export default InputField;
